struct Test { x: u8, y: u64,
} fn main() { let mut t = Test { x: 0, y: 0, // the macro generates a new variable called // "tracker" that stores the changes tracker: 0, }; t.set_x(42); // let's check whether the change was detected assert!(t.changed(Test::x())); // reset t so we don't track old changes t.reset(); t.set_x(42); // same value so no change assert!(!t.changed(Test::x()));
} More information about the tracker crate can be found here So in short the tracker::track macro provides different getters and setters that will mark struct fields as changed. You also get a method that checks for changes and a method to reset the changes.

