For our model we only need to store the two icon names and if both of them are identical. #[tracker::track]
struct AppModel { first_icon: &'static str, second_icon: &'static str, identical: bool,
} The message type is also pretty simple: we just want to update the icons. enum AppMsg { UpdateFirst, UpdateSecond,
} There are a few notable things for the AppUpdate implementation. First, we call self.reset() at the top of the update function body. This ensures that the tracker will be reset so we don't track old changes. Also we use setters instead of assignments because we want to track these changes. Yet, you could still use the assignment operator if you want to apply changes without notifying the tracker. impl AppUpdate for AppModel { fn update(&mut self, msg: AppMsg, _components: &(), _sender: Sender<AppMsg>) -> bool { // reset tracker value of the model self.reset(); match msg { AppMsg::UpdateFirst => { self.set_first_icon(random_icon_name()); } AppMsg::UpdateSecond => { self.set_second_icon(random_icon_name()); } } self.set_identical(self.first_icon == self.second_icon); true }
}

