impl Widgets<AppModel, ()> for AppWidgets { view! { main_window = gtk::ApplicationWindow { set_class_active: track!(model.changed(AppModel::identical()), "identical", model.identical), set_child = Some(&gtk::Box) { set_orientation: gtk::Orientation::Horizontal, set_spacing: 10, set_margin_all: 10, append = &gtk::Box { set_orientation: gtk::Orientation::Vertical, set_spacing: 10, append = &gtk::Image { set_pixel_size: 50, set_icon_name: track!(model.changed(AppModel::first_icon()), Some(model.first_icon)), }, append = &gtk::Button { set_label: "New random image", connect_clicked(sender) => move |_| { send!(sender, AppMsg::UpdateFirst); } } }, append = &gtk::Box { set_orientation: gtk::Orientation::Vertical, set_spacing: 10, append = &gtk::Image { set_pixel_size: 50, set_icon_name: track!(model.changed(AppModel::second_icon()), Some(model.second_icon)), }, append = &gtk::Button { set_label: "New random image", connect_clicked(sender) => move |_| { send!(sender, AppMsg::UpdateSecond); } } }, } } } fn post_init() { relm4::set_global_css(b".identical { background: #00ad5c; }"); }
} The overall UI is pretty simple: A window that contains a box. This box has two boxes itself for showing the two icons and the two buttons to update those icons. There's also something new. With the pre_init() and post_init() functions you can add custom code that will be run either before or after the code the widget macro generates for initialization. In our case we want to add custom CSS that sets the background color for elements with class name "identical". fn post_init() { relm4::set_global_css(b".identical { background: #00ad5c; }"); }

